Once the query object has been built, use one of the following methods to select the expected number of rows: opt: one or zero rows (error otherwise). one: exactly one row (error otherwise). iter: iterator of zero or more rows. all: like iter, but collects the rows in a Vec. Here are some example uses: author_by_id().bind(&client, &0).opt().await?;
author_by_id().bind(&client, &0).one().await?; // Error if this author id doesn't exist
authors().bind(&client).all().await?;
authors().bind(&client).iter().await?.collect::<Vec<_>>(); // Acts the same as the previous line Note If your queries are sync, you don't need to .await them.
